import "./products.css";
function Product() {
  const date = new Date();
 
  const data = [
    {
      fullName: "pirzola",
      price: "25₺",
      yurl: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRoFdfgF8rsuaq7UZIWVv1pYtcx5PFzL1Fn-Q&usqp=CAU",
    },
    {
      fullName: "Dana Bonfile",
      price: "39$",
      yurl: "https://i.ytimg.com/vi/6aOkU9GLs6k/sddefault.jpg#404_is_fine",
    },
  ];

  return (
    <div className="total">
      <h1>Products</h1>
      <div className="products">
        <ProductItem
          fullName={data[0].yemek}
          price={data[0].prices}
          yurl={data[0].link}
